import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from "./SlideShow/Navbar";
import HomePage from "./pages/HomePage";
import Footer from "./SlideShow/Footer";

function App() {
    return (
        <div className="App">
            <Navbar/>
            <HomePage></HomePage>
            <Footer/>
        </div>
    );
}

export default App;
